ED_TITLE:"The Pin Is Stuck!",UNPIN_MESSAGE_FAILED_BODY:"Discord failed to unpin that message for some reason. Sorry about that.",NO_INPUT_DEVICES:"No Input Devices",NO_OUTPUT_DEVICES:"No Output Devices",NO_VIDEO_DEVICES:"No Video Devices",DEFAULT:"Default",DEVICE_NO_PERMISSION:"Device {index}",CONNECTION_STATUS_CONNECTED:"Connected",CONNECTION_STATUS_CONNECTING:"Connecting",CONNECTION_STATUS_AUTHENTICATING:"Authenticating",CONNECTION_STATUS_AWAITING_ENDPOINT:"Awaiting Endpoint",CONNECTION_STATUS_DISCONNECTED:"Disconnected",CONNECTION_STATUS_VOICE_CONNECTED:"Voice Connected",CONNECTION_STATUS_VIDEO_CONNECTED:"Video Connected",CONNECTION_STATUS_RTC_CONNECTING:"RTC Connecting",CONNECTION_STATUS_ICE_CHECKING:"ICE Checking",CONNECTION_STATUS_NO_ROUTE:"No Route",CONNECTION_STATUS_RTC_DISCONNECTED:"RTC Disconnected",IP_ADDRESS_SECURED:"IP Address Secured",DEBUG:"Debug",DISCONNECT:"Disconnect",RTC_CONNECTION_INFO:"Connection Info",RTC_CONNECTION:"RTC Connection",RTC_CONNECTION_STATE_AWAITING_ENDPOINT:"\nDiscord is powering up a RTC server for you! If your connection is stuck here, we may be experiencing a\nregion outage. Oh noes! Check our [service status page]({url}) for more info or consider asking your server owner\nto temporarily switch regions.\n",RTC_CONNECTION_STATE_CONNECTING:"\nA RTC server has been allocated for you and Discord is attempting to connect to it. Get ready to roll out.\n",RTC_CONNECTION_STATE_AUTHENTICATING:"\nDiscord has connected to your real-time communication server and is securing the connection.\n",RTC_CONNECTION_STATE_RTC_CONNECTING:"\nLocked and loaded! Discord has established a secure connection to your real-time communication server and is\nattempting to send data.\n",RTC_CONNECTION_STATE_ICE_CHECKING:"\nShields Up! Discord has established a secure connection to your real-time communication server and is attempting to send data.\nIf your browser connection is stuck in this step, check out [this swanky article]({url}) to help resolve the problem.\n",RTC_CONNECTION_STATE_NO_ROUTE:"\nDoh. Discord can't establish a UDP connection to your real-time communication server. We'll try again in a moment.\nIf Discord keeps getting stuck in this step, check out [this fancy article]({url}) to help resolve the problem.\n",RTC_CONNECTION_STATE_RTC_CONNECTED:"\nDiscord is connected to your real-time communication server on **{hostname}** with an average ping of **{averagePing}ms**. The last\nping was **{lastPing}ms**.\n\nIf the ping is not consistent or more than {badPing}ms, consider asking the server owner to switch to another region.\n",RTC_CONNECTION_STATE_DISCONNECTED:"\nHamsters may have fallen off their wheels. Discord's connection to your real-time communication server has been interrupted. We'll attempt\nto re-establish the connection in a moment.\n",TUTORIAL_SKIP:"Already a pro? [Skip the tips](onSkipClick)",TUTORIAL_CLOSE:"Got it!",CHANNEL_MUTE_TOOLTIP:"\nMuting a channel prevents unread indicators and notifications from appearing unless you are mentioned.\n  ",SHOW_MUTED:"Show {n} Muted",HIDE_MUTED:"Hide {n} Muted",WELCOME_MESSAGE_OWNER_TITLE:"Welcome to your server, {username}!",WELCOME_MESSAGE_TITLE:"Welcome to the server, {username}!",WELCOME_MESSAGE_INSTANT_INVITE:"\n**Invite your friends** to this server by clicking on a [share button](onShareClick) when you're ready.\n  ",WELCOME_MESSAGE_DESKTOP_APPS:"\n**Download** the [desktop app](onDownloadClick) for system-wide Push to Talk, lower CPU and bandwidth usage, and more.\n  ",WELCOME_MESSAGE_TUTORIAL:"**Learn about Discord** at your own pace by exploring the floating quest indicators.",WELCOME_MESSAGE_MOBILE_APPS:"\n**Stay connected** to your server from [your smartphone](onDownloadClick) and even use Discord while console gaming.\n  ",WELCOME_MESSAGE_SUPPORT:"\n**Reach us** via [our help desk]({supportURL}) or on Twitter [@discordapp]({twitterURL}) if you have any\nquestions or need help.\n  ",TIP_VOICE_CONVERSATIONS_TITLE:"Raise Your Voice",TIP_VOICE_CONVERSATIONS_BODY:"\nThis is your **voice control panel.**\n\nUse these buttons to unmute your microphone, deafen your headphones, or modify settings.\nYou can adjust your speaking mode from **Voice Activity to Push To Talk** by clicking the cog.\n  ",TIP_WRITING_MESSAGES_TITLE:"Have a Conversation",TIP_WRITING_MESSAGES_BODY:"\nThis is where you'll be typing all your opinions and ideas.\n\nTo keep things fancy we've included Markdown syntax support so you can **make a point** or\n__stomp your feet.__ You can also **drag & drop** images or files right here to quickly\nshare those cat GIFs. Not too many though.\n",TIP_ORGANIZE_BY_TOPIC_TITLE:"Organize by Channels",TIP_ORGANIZE_BY_TOPIC_BODY:"\n**Text channels** let you separate your chat conversations by topic. You can hop around\nchannels easily and even **@mention** friends to send notifications to their desktop or phone.\n\n**Voice Channels** let you separate your conversations into groups as big or small as you'd like.\nClick on a channel to join a conversation. You'll stay in that Voice Channel even if you switch\ntext channels too!\n",TIP_WHOS_ONLINE_TITLE:"What're You Playing?",TIP_WHOS_ONLINE_BODY:"\nThis list shows who's in the current channel.\n\nAnyone using the desktop apps will also show what game they're currently playing. Clicking on a\nuser will reveal **individual settings** like volume controls or admin controls.\n",TIP_INSTANT_INVITE_TITLE:"Invite Your Friends",TIP_INSTANT_INVITE_BODY:"\nMouse over any text or voice channel to reveal the share button. Use the generated link to invite\npeople directly into the chosen channel.\n\nAdvanced Invite Links allow you to set usage restrictions such as how many people can join with that\nlink or how long it lasts.\n",TIP_SERVER_SETTINGS_TITLE:"Control Your Server",TIP_SERVER_SETTINGS_BODY:"\nClick here to access your server's settings.\n\nYou can modify all sorts of things like permissions and roles, choose your voice server region,\nsetup an AFK channel, manage invite links, manage banned users, or even delete your server entirely.\n",TIP_DIRECT_MESSAGES_TITLE:"Start a Private Conversation",TIP_DIRECT_MESSAGES_BODY:"\nSee everyone across all of your servers from this list.\n\nYou can have a private one-on-one chat conversation by choosing a friend and chatting away!\nDirect Messages are great for reaching people via notifications even when they're AFK.\n",TIP_CREATE_MORE_SERVERS_TITLE:"Servers Everywhere!",TIP_CREATE_MORE_SERVERS_BODY:"\nClick this plus button to create a new server.\n\nBecause servers are free, you can create as many as you want. Each server lets you have a unique\nplace for different groups of people. You can delete servers too if you no longer need it.\n",TIP_CREATE_FIRST_SERVER_TITLE:"Create Your Own Server",TIP_CREATE_FIRST_SERVER_BODY:"\nClick this plus button to create your own server.\n\nEach server lets you have a unique place for different groups of people. You can delete a server\ntoo if you no longer need it. Best of all, because servers are free, you can create as many as\nyou want.\n",TIP_FRIENDS_LIST_TITLE:"See Your Friends",TIP_FRIENDS_LIST_BODY:"\nClick here to view your direct messages and see the status of everyone in all of your servers.\n\nWhen you receive a DM, it'll show up underneath your avatar here for easy access.\n",BAN_USER_TITLE:"Ban '{user}'",BAN_USER_CONFIRMED:"'{user}' has been banned from the server.",BAN_CONFIRM_TITLE:"Swing The Ban Hammer on '!!{username}!!'",FORM_LABEL_DELETE_MESSAGE_HISTORY:"Delete Message History",FORM_LABEL_REASON_KICK:"Reason for Kick",FORM_LABEL_REASON_BAN:"Reason for Ban",FORM_PLACEHOLDER_REASON:"Reason",DELETE_MESSAGE_HISTORY_OPTION_NONE:"Don't Delete Any",DELETE_MESSAGE_HISTORY_OPTION_24HR:"Previous 24 Hours",DELETE_MESSAGE_HISTORY_OPTION_7D:"Previous 7 Days",NO_TEXT:"No",YES_TEXT:"Yes",CLOSE:"Close",SEND:"Send",CHOOSE:"Choose",SAVE:"Save",SELECT:"Select",START:"Start",ADD:"Add",NEXT:"Next",SAVE_CONTENT_SUCCESS_MOBILE:"Content Saved!",SAVE